import React from "react";
import { Box, Button } from "@material-ui/core";
import { Formik, Form, FormikHelpers } from "formik";
import FormField from "../components/Form/FromField";
import { connect } from "react-redux";
import { register } from "../modules/auth/authOperations";

type AddBankFormType = {
  handleSubmit: (values: any, actions: FormikHelpers<any>) => any;
  setIsAddBank: (isOk: boolean) => void;
  register: any;
  isLoading: boolean;
};

const Register: React.FC<AddBankFormType> = ({ register, isLoading }) => {
  return (
    <Box
      display="flex"
      justifyContent="center"
      alignItems="center"
      height="100vh"
    >
      <Box
        width={400}
        height={400}
        border="1px solid"
       flexDirection="column"
        display="flex"
        justifyContent="center"
        alignItems="center"
      >
        <Box>
          <h1>Register</h1>
        </Box>
        <Formik
          initialValues={{
            username: "",
            email: "",
            password: "",
          }}
          onSubmit={async (values, actions) => {
            try {
              await register(values);
            } catch (error) {
              console.log("error", error);
            }
          }}
        >
          {(props) => (
            <Form>
              <Box>
                <FormField
                  {...props}
                  name="username"
                  placeholder="username"
                  label="username"
                />
              </Box>
              <Box>
                <FormField
                  {...props}
                  name="email"
                  placeholder="email"
                  label="email"
                />
              </Box>
              <Box>
                <FormField
                  {...props}
                  name="password"
                  placeholder="password"
                  label="password"
                />
              </Box>
              {isLoading ? (
                "Loading ..."
              ) : (
                <Button type="submit">Register</Button>
              )}
            </Form>
          )}
        </Formik>
      </Box>
    </Box>
  );
};

const mapStateToProps = (state) => {
  return {
    isLoading: state.authReducer.isLoading,
  };
};

const mapDispatchToProps = {
  register,
};

//export default  Register
export default connect(mapStateToProps, mapDispatchToProps)(Register);
